import React from "react";
import '../../App.css'
import Data from "./cities.json";

const Home = ()=>{
    return (
        <div className="App">
            <div className="posts">
                {Data.map(post =>{
                    <div key={post.id} className="post">
                        <h4>{post.name}</h4>
                        </div>
                })}
            </div>
        </div>
    )
}

export default Home
